window.bookSummaryJSON = "<p><b>Wise-cracking, corporate bounty hunter Malcolm Graves has a knack for finding trouble. </b>&nbsp;</p> <p>After 20 years working for Pervenio Corp chasing bounties and extinguishing rebellions throughout the solar system, he’s on a routine pickup job hunting a wealthy offworlder heir who ran away from home. But when a mad scientist gets his hands on the boy, Malcolm finds himself caught up in a twisted plot to develop working androids.&nbsp;&nbsp;</p> <p>Join Malcolm on a mission gone awry in this prequel novella to <i>USA Today</i> best seller Rhett C. Bruno's Children of Titan series.&nbsp;&nbsp;</p>"; 
